      field_form_embed:
        value: "<link href=\"//cdn-images.mailchimp.com/embedcode/slim-10_7.css\" rel=\"stylesheet\" type=\"text/css\">\r\n\t\t\t<style type=\"text/css\">\r\n\t\t\t\t#mc_embed_signup{background:#fff; clear:left; font:14px Helvetica,Arial,sans-serif; }\r\n\t\t\t\t/* Add your own Mailchimp form style overrides in your site stylesheet or in this style block.\r\n\t\t\t\t   We recommend moving this block and the preceding CSS link to the HEAD of your HTML file. */\r\n\t\t\t</style>\r\n\t\t\t<div id=\"mc_embed_signup\">\r\n\t\t\t\t<form action=\"https://alphafox-design.us11.list-manage.com/subscribe/post?u=9e6e7f117cc33d5901f2c9ad0&amp;id=02c18215cc\" method=\"post\" id=\"mc-embedded-subscribe-form\" name=\"mc-embedded-subscribe-form\" class=\"validate\" target=\"_blank\" novalidate>\r\n\t\t\t\t    <div id=\"mc_embed_signup_scroll\">\r\n\t\t\t\t\t<label for=\"mce-EMAIL\">Subscribe to our mailing list</label>\r\n\t\t\t\t\t<input type=\"email\" value=\"\" name=\"EMAIL\" class=\"email\" id=\"mce-EMAIL\" placeholder=\"email address\" required>\r\n\t\t\t\t    <!-- real people should not fill this in and expect good things - do not remove this or risk form bot signups-->\r\n\t\t\t\t    <div style=\"position: absolute; left: -5000px;\" aria-hidden=\"true\"><input type=\"text\" name=\"b_9e6e7f117cc33d5901f2c9ad0_02c18215cc\" tabindex=\"-1\" value=\"\"></div>\r\n\t\t\t\t    <div class=\"clear\"><input type=\"submit\" value=\"Subscribe\" name=\"subscribe\" id=\"mc-embedded-subscribe\" class=\"button\"></div>\r\n\t\t\t\t    </div>\r\n\t\t\t\t</form>\r\n\t\t\t</div>"
      field_form_modal:
        value: '1'
      field_modal_header:
        value: 'Demo newsletter signup'
      field_modal_intro:
        value: "<p>We're glad you've decided to stay in touch. We promise not to bug you too much!</p>\r\n"
        format: basic_html
      field_modal_trigger:
        value: 'Signup today!'
